webpackJsonp([0x6c5958285ed1],{4823:function(a,t){a.exports={pathContext:{group:[{node:{fields:{title:"Baptism Party",date:"03 Apr 2000",slug:"/2000-04-03-baptism-party/",tags:"Y2000"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/04/Dscn0007001.jpg" height="332" width="350" border="0" alt="crh03Apr.jpg: " /></p>\n<p>The best picture from Christopher\'s party was in fact taken by accident. This is his "Mamma Rhino / Rhino Runt" headband.</p>'},next:{fields:{title:"Grandma and Grandpa",date:"31 Mar 2000",slug:"/2000-03-31-grandma-and-grandpa/"}},previous:{fields:{title:"Tuesday",date:"04 Apr 2000",slug:"/2000-04-04-tuesday/"}}},{node:{fields:{title:"Grandma and Grandpa",date:"31 Mar 2000",slug:"/2000-03-31-grandma-and-grandpa/",tags:"Y2000"},html:"<p>Right on time at 4:40pm, my folks, Christopher's grandparents, arrived in Hamburg from Minnesota to see their grandson. Christopher was a star, cooing and gurgling and otherwise making a very happy and satisfied first impression. He should be set for life now.</p>\n<p>We had the camera along at the airport, but forgot about it. We never took it out of the diaper bag. Oh well.</p>"},next:{fields:{title:"We're No Angels",date:"28 Mar 2000",slug:"/2000-03-28-were-no-angels/"}},previous:{fields:{title:"Baptism Party",date:"03 Apr 2000",slug:"/2000-04-03-baptism-party/"}}},{node:{fields:{title:"We're No Angels",date:"28 Mar 2000",slug:"/2000-03-28-were-no-angels/",tags:"Y2000"},html:"<p>In all fairness, after I complained yesterday that Christopher is difficult at times, today Mama reports that 'he was an angel' the entire day, including a shopping trip to Hamburg with a stop at IKEA, which taxes the patience of any mere mortal.</p>\n<p>When Mama told this to me, though, I could only think of the film with Humphrey Bogart and Peter Ustinov. What was the snake's name again? Christopher, perhaps?</p>"},next:{fields:{title:"13 Weeks = 3 Months",date:"27 Mar 2000",slug:"/2000-03-27-13-weeks-3-months/"}},previous:{fields:{title:"Grandma and Grandpa",date:"31 Mar 2000",slug:"/2000-03-31-grandma-and-grandpa/"}}}],pathPrefix:"",first:!1,last:!1,index:1069,pageCount:1101}}}});
